import '../css/NurPatientList.css';
const DisPatInfo = () => {
    return (
        <div className="disBox">
            <div className="boxHeader">
                <img src="./public/img/write.png"/>
                <h3 id="boxHeader">환자 퇴원 정보 (2024-06-01 16:00)</h3>
            </div>
        </div>
    )
}

export default DisPatInfo;
